package com.noej.may222jm2.main;

public class M3 {
	private double hab;
	private double cha;
	private double gob;
	private double moks;

	public M3() {
		// TODO Auto-generated constructor stub
	}

	public M3(double hab, double cha, double gob, double moks) {
		super();
		this.hab = hab;
		this.cha = cha;
		this.gob = gob;
		this.moks = moks;
	}

	public double getHab() {
		return hab;
	}

	public void setHab(double hab) {
		this.hab = hab;
	}

	public double getCha() {
		return cha;
	}

	public void setCha(double cha) {
		this.cha = cha;
	}

	public double getGob() {
		return gob;
	}

	public void setGob(double gob) {
		this.gob = gob;
	}

	public double getMoks() {
		return moks;
	}

	public void setMoks(double moks) {
		this.moks = moks;
	}
}
